import React from 'react';
import Diapo from '../../data/diapo.json';

const {image} = Diapo;

const Main = (props) => {

  return (
    <main className="container row">
      <div className="">
        {
          alter.map((alter,k) => {
            return (
              <>
              <img key={k} alt={alter.textAlternative} />
              </>
          )
        })
      }
    </div>
  </main>
)
}

export default Main;
